CREATE OR REPLACE PROCEDURE         FOCUSPP.FCS_LOGIN_BEAT (P_UNAME IN VARCHAR2, P_SESSIONID IN VARCHAR2)
IS
BEGIN    
    DELETE FROM APP_USER_LOGGED WHERE USER_NAME = P_UNAME;
    --INSERT INTO APP_USER_LOGGED (USER_NAME, LOGGED_ON, SESSION_ID) VALUES (P_UNAME, SYSDATE, P_SESSIONID);
    COMMIT;
END;
